import React from 'react';

const BillPrint = ({ billDetails }) => {
    const handlePrint = () => {
        window.print();
    };

    return (
        <div>
            <h2>Bill Details</h2>
            <pre>{JSON.stringify(billDetails, null, 2)}</pre>
            <button onClick={handlePrint}>Print Bill</button>
        </div>
    );
};

export default BillPrint;
